const VQAMain = () => {
  const [selectedDateset, setDataset] = useState(datasets[0].id);
  const [isLoading, setIsLoading] = useState(false);
  const [images, setImages] = useState([]);
  const [filterediImages, setFilterediImages] = useState([]);
  const [searchQueury, setSearchQueury] = useState("");

  const setSelectedDatasetId = (id) => {
    return setDataset(id);
  };

  const onChangeSearch = (event) => {
    return setSearchQueury(event.target.value);
  };

  useEffect(() => {
    getImages();
  }, [selectedDateset]);

  useEffect(() => {
    filterImage();
  }, [searchQueury]);

  const filterImage = () => {
    setFilterediImages(images.filter((i) => i.title.includes(searchQueury)));
  };

  const getImages = async () => {
    setIsLoading(true)
    try {
      setTimeout(() => {

        // fetch(`http://127.0.0.1:5000/getimages?dataset=${selectedDateset}`).then(response => {

        //   const data = response.json(); 

        // })

      // const response = fetch(`http://127.0.0.1:5000/getimages?dataset=${selectedDateset}`);
      // const data = await response.json();

        // const data = a;
        const imagesRes = data.map((d) => {
          const decodedImage = atob(d.image);
          const byteArray = new Uint8Array(decodedImage.length);
          for (let i = 0; i < decodedImage.length; i++) {
            byteArray[i] = decodedImage.charCodeAt(i);
          }

          // Create a blob URL for the image
          const blob = new Blob([byteArray], { type: "image/jpeg" });
          const imageUrl = URL.createObjectURL(blob);

          return {
            image: imageUrl,
            title: d.organ,
            caption: `This is an image of ${d.organ}`,
            id: d.image_name,
          };
        });
        setFilterediImages(imagesRes);
        setImages(imagesRes);
        setIsLoading(false)
      }, 1000);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <Box display={"flex"} width={1}>
      <VQAHeader
        datasets={datasets}
        onDatasetClick={setSelectedDatasetId}
        selectedDataset={selectedDateset}
        onChangeSearch={onChangeSearch}
        searchQueury={searchQueury}
      />
      <Box pt={8} width={1}>
        <VQAImages images={filterediImages} isLoading={isLoading} />
      </Box>
    </Box>
  );
};

export default VQAMain;
